--
-- Volcado de datos para la tabla `mdl_scale`
--

INSERT INTO `mdl_scale` (`id`, `courseid`, `userid`, `name`, `scale`, `description`, `descriptionformat`, `timemodified`) VALUES
(1, 0, 0, 'Vías de conocimiento separadas y conectadas', 'Conocimiento mayoritariamente separado,Separado y conectado,Conocimiento mayoritariamente conectado', 'La escala está basada en la teoría de las vías de conocimiento separadas (aprendizaje individual)  y conectadas (aprendizaje colaborativo). Esta teoría describe dos maneras diferentes con las que podemos evaluar y aprender a partir de lo que vemos y oímos. <li><strong> Conocedores separados (individulaistas) </strong> se mantiene lo la más objetivso posible, sin incluir sentimientos y emociones. En una discusión con otras personas, les gusta defender sus propias ideas, usando la lógica para encontrar fisuras en las ideas del adversario. </li> <li> <strong> Conocedores conectados (colaborativos) </strong> son más sensibles a otras personas. Son expertos en empatía y tienden a escuchar y hacer preguntas hasta que sienten que pueden conectar y \"entender las cosas desde otros punto de vista\". Aprenden tratando de compartir experiencias lo que les permite encontrar el conocimiento en las demás personas.', 0, 1710537394),
(2, 0, 0, 'Escala de competencias por defecto', 'Aún no competente,Competente', 'Una escala de calificación binaria que no proporciona más información que la de si alguien ha demostrado o no competencia.', 0, 1710537394);

